Somos a maior plataforma tecnológica do mercado veterinário do Brasil. Oferecemos ferramentas de auxílio e gestão no atendimento veterinário, como: informações farmacológicas completas de mais de 4.000 medicamentos e princípios ativos. Além de conteúdos semanais sobre o mercado veterinário para estudantes e Médicos Veterinários de forma gratuita, de onde estiver e tudo em um só lugar!

CONTEÚDOS EXCLUSIVOS

Confira diversos conteúdos gratuitos como palestras semanais, podcasts e estudos exclusivos sobre medicina veterinária no Vet Smart.

- Palestras gratuitas semanalmente: acompanhe nossas transmissões ao vivo, obtenha certificados e concorra a prêmios exclusivos. Saiba quais são as próximas palestras entrando em nosso site ou aplicativo e aproveite para conferir nosso catálogo com centenas de conteúdos gratuitos sobre temas atualizados e ministrada por professores renomados;

- Podcast de medicina veterinária: ouça de onde estiver, a hora que quiser, nossos episódios que abordam temas variados e relevantes sobre medicina veterinária.

MAIS DE 4 MIL PRODUTOS PARA CONSULTA

Em nosso bulário veterinário totalmente online, você encontra um catálogo de mais de 4.000 produtos para bovinos e equinos revisados constantemente, além de conferir informações completas sobre medicamentos, como:

- Princípios ativos e classificação terapêutica;

- Administração e doses (doses recomendadas, via, frequência de utilização, duração de tratamento);

- Apresentações e concentrações;

- Indicações e contraindicações;

- Interações medicamentosas (tipo de interação, grau de interação, efeito clínico, mecanismo de ação e conduta)

- Farmacologia (farmacodinâmica, farmacocinética, efeitos adversos, superdosagem e monitoramento);

- Substâncias ativas, classificação, tipo de receita e espécies relacionadas.

COMUNIDADE DE MÉDICOS VETERINÁRIOS

Pergunte, converse e aprenda com a maior comunidade de Medicina Veterinária do Brasil. Conheça espaços dedicados para o compartilhamento e troca de experiências entre membros da comunidade veterinária do Vet Smart.

Deze ABC-versie van de app Verpleegkundige zorgresultaten bevat alleen de diagnoses en zorgresultaten die beginnen met een a, b of c. Zo kun je kennismaken met de app van de NOC. Bevalt deze beperkte versie dan kun je vanuit de ABC app de volledige versie kopen.

Verpleegkundige zorgresultaten is de Nederlandse vertaling van Nursing Outcomes Classification (NOC). Deze app is gebaseerd op de derde, herziene Nederlandse editie die weer een vertaling is van de vijfde Amerikaanse druk.

De app biedt een gestructureerde indeling van verpleegkundige diagnoses en zorgresultaten. De belangrijkste kenmerken van de NOC zijn:
• volledigheid: 490 geactualiseerde zorgresultaten, waarvan 107 geheel nieuwe;
• evidence-based;
• duidelijke en klinisch zinvolle terminologie;
• gebruiksvriendelijke structuur;
• toepasbaar in verschillende disciplines;
• getoetst in het veld;
• gecombineerd met de NANDA-diagnoses (2012-2014 NANDA-I).

Verpleegkundige zorgresultaten draagt bij tot adequaat onderwijs in de klinische besluitvorming. De app voorziet in standaardisering en definiëring van de benodigde kennis voor verpleegkundig onderwijs en de verpleegkundige praktijk. Tevens is het een hulpmiddel om leerplannen beter te laten aansluiten op de praktijk.

Deze ABC-versie van de app Verpleegkundige interventies bevat alleen de diagnoses en interventies die beginnen met een a, b of c. Zo kun je kennismaken met de app van de NIC. Bevalt deze beperkte versie dan kun je vanuit de ABC app de volledige versie kopen.

Verpleegkundige interventies is de Nederlandse vertaling van Nursing Interventions Classification (NIC). Deze app is gebaseerd op de vierde, herziene Nederlandse editie die weer een vertaling is van de zesde Amerikaanse druk. 

De app biedt een gestructureerde indeling van verpleegkundige diagnoses en interventies. De belangrijkste kenmerken van de NIC zijn:
•	volledigheid: meer dan 550 interventies, waarvan 23 geheel nieuwe en 133 herziene interventies;
•	evidence-based;
•	vanuit de bestaande praktijk ontwikkeld;
•	weerspiegelt de actuele klinische praktijk en recent onderzoek;
•	duidelijke en klinisch zinvolle terminologie;
•	in het veld getoetst;
•	gecombineerd met de NANDA-diagnoses ( 2012-2014 NANDA-I).

Verpleegkundige interventies draagt bij tot adequaat onderwijs in de klinische besluitvorming. De app voorziet in standaardisering en definiëring van de benodigde kennis voor verpleegkundig onderwijs en de verpleegkundige praktijk. Tevens is het een hulpmiddel bij de ontwikkeling van leerplannen, die daardoor beter aansluiten op de praktijk.

Verpleegkundige interventies is primair bedoeld voor verpleegkundigen. Zij kunnen met deze app een keuze maken uit mogelijke interventies. Daarnaast kan de app een hulpmiddel zijn bij de communicatie over behandelingen met andere zorgverleners.

